import axios from "axios"

function LoadImages(){
    const [state, setState]= useState([]);
    
    axios
    .get("https://api.unsplash.com/photos/?client_id=cJyNzMklJRFYmMLOj-MxrZJ1ONPJ-zNbuF6V5jq77Tw")
    .then((data)=>{
        //console.log(data);
        setState(data.data);
    })
    return state;
}

export {LoadImages}
